import React, { useState, memo } from 'react'
import  { Box, Grid, Paper, Typography } from '@mui/material'
import { BaseGraph } from './BaseGraph';
import { defaultGraphScheme } from '../tools/graphtools';


export const HomeGraph = () => {
    console.log('enter - HomeGraph')

    return (<>
        <Typography align='center' noWrap variant='h6' component='div' sx={{size:'large'}} color='primary.main'>
            Cancer susceptibility gene visualizations using a Graph Database approach
        </Typography>

        <Paper 
            elevation={4}         
            sx={{ flexGrow: '1',
                    minWidth: '200px',
                    color: 'white',
                    backgroundColor: 'white'}}>
            <BaseGraph 
                drawerOpen={false}
                name={'gene'}
                genes={['BRCA1','BRCA2']}
                organs={[]}
                syndromes={[]}
                diseases={[]}
                finalVerdict='Confimred'
                graphScheme={defaultGraphScheme}
            />
        </Paper>
        <Paper 
            elevation={4}         
            sx={{ flexGrow: '1',
                    minWidth: '200px',
                    color: 'white',
                    backgroundColor: 'white'}}>
            <BaseGraph 
                drawerOpen={false}
                name={'organ'}
                genes={['BRCA1','BRCA2']}
                organs={[]}
                syndromes={[]}
                diseases={[]}
                finalVerdict='Confimred'
                graphScheme={defaultGraphScheme}
            />
        </Paper>
        <Paper 
            elevation={4}         
            sx={{ flexGrow: '1',
                    minWidth: '200px',
                    color: 'white',
                    backgroundColor: 'white'}}>
            <BaseGraph 
                drawerOpen={false}
                name={'syndrome-organ'}
                genes={['BRCA1','BRCA2']}
                organs={[]}
                syndromes={[]}
                diseases={[]}
                finalVerdict='Confimred'
                graphScheme={defaultGraphScheme}
            />
        </Paper>
    </>)
}
